# pylint: skip-file

import pytest

from monday import wave


def test_basic_test_1():
    assert wave("hello") == ["Hello", "hEllo", "heLlo", "helLo", "hellO"]


def test_basic_test_2():
    assert wave("codewars") == ["Codewars", "cOdewars", "coDewars",
                                "codEwars", "codeWars", "codewArs", "codewaRs", "codewarS"]


def test_basic_test_3():
    assert wave("") == []


def test_basic_test_4():
    assert wave("two words") == ["Two words", "tWo words", "twO words",
                                 "two Words", "two wOrds", "two woRds", "two worDs", "two wordS"]


def test_basic_test_5():
    assert wave(" gap ") == [" Gap ", " gAp ", " gaP "]


def test_basic_test_6():
    assert wave("a       b    ") == ["A       b    ", "a       B    "]


def test_basic_test_7():
    assert wave("this is a few words") == ["This is a few words", "tHis is a few words", "thIs is a few words", "thiS is a few words", "this Is a few words", "this iS a few words", "this is A few words",
                                           "this is a Few words", "this is a fEw words", "this is a feW words", "this is a few Words", "this is a few wOrds", "this is a few woRds", "this is a few worDs", "this is a few wordS"]


